import { Helmet } from 'react-helmet-async';
import { faker } from '@faker-js/faker';
// @mui
import { useTheme } from '@mui/material/styles';
import { Grid, Container, Typography } from '@mui/material';
// components
import Iconify from '../components/iconify';
// sections
import {
  AppTasks,
  AppNewsUpdate,
  AppOrderTimeline,
  AppCurrentVisits,
  AppWebsiteVisits,
  AppTrafficBySite,
  AppWidgetSummary,
  AppCurrentSubject,
  AppConversionRates,
} from '../sections/@dashboard/app';
import { useAuth } from '../context/supaContex';

// ----------------------------------------------------------------------

export default function PAC() {
  const theme = useTheme();
  const { user, linkPAC } = useAuth();
  //console.log(user)
  //console.log(linkLooker)
  return (
    <>
      <Helmet>
        <title> GADPCH 4.O </title>
      </Helmet>

      <Container maxWidth="xl" style={{ height: '100vh', display: 'flex', flexDirection: 'column' }}>
  <iframe
    title="Registro de PAC"
    src={linkPAC}
    style={{ border: 0, width: '100%', flex: 1,}}
    allowFullScreen
    
/>
</Container>



    </>
  );
}
